import React, { useEffect, useState } from "react";

const Country = (props) => {
  const [name, setName] = useState("");
  useEffect(() => {
    try {
      const CountryName = props.location.props.name;
    } catch (err) {
      const CountryName = "Canada";
    }

    setName(CountryName);
    //fetch data using name
  }, [CountryName]);

  return (
    <div>
      <h1>Country: {name}</h1>
    </div>
  );
};

export default Country;
